import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./component/homeome";  // Assurez-vous que le chemin est correct
import Quiz from "./component/Quiz";  // Assurez-vous que le chemin est correct
import { CssBaseline, Container } from "@mui/material";

function App() {
  return (
    <Router>  {/* Le composant Router est n√©cessaire ici */}
      <CssBaseline />
      <Container>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/quiz" element={<Quiz />} />
        </Routes>
      </Container>
    </Router>  // Enveloppez le tout dans le Router
  );
}

export default App;
